import React from 'react';
import './App.css';
import Container from 'react-bootstrap/Container'

import axios from 'axios';

var obj;
var response;

var id;
var datetime;
var name;
var summary;
var url;
var type
var location;

var elements;

export default class PersonList extends React.Component {
  state = {
    persons: []
  }

  componentDidMount() {
    axios.get(`https://polisen.se/api/events?DateTime=2021-01&type=Misshandel`)
      .then(res => {
        obj = res.data;
        response = obj[Object.keys(obj)[0]];
        id = JSON.stringify(response[Object.keys(response)[0]]);
        datetime = JSON.stringify(response[Object.keys(response)[1]]);
        datetime = JSON.stringify(response[Object.keys(response)[2]]);
        name = JSON.stringify(response[Object.keys(response)[3]]);
        summary = JSON.stringify(response[Object.keys(response)[4]]);
        url = JSON.stringify(response[Object.keys(response)[5]]);
        type = JSON.stringify(response[Object.keys(response)[6]]);
        location = JSON.stringify(response[Object.keys(response)[7]]);

        elements = {id: id, datetime: datetime}
        const persons = elements;
        this.setState({ persons });
      })
  }

  render() {
    return (
      <Container>
<table>
  <tr>
    <th>Id</th>
    <th>Datetime</th>
    <th>name</th>
    <th>summary</th>
    <th>url</th>
    <th>type</th>
    <th>location</th>
  </tr>
  <tr>
    <td>{ this.state.persons.id}</td>
    <td>{ this.state.persons.datetime}</td>
  </tr>
</table>
</Container>
    )
  }
}
